	(277, 'Industria farmacéutica y progreso médico', '', 'http://www.fundaciogrifols.org/docs/pub3%20esp.pdf', '2005-06-02', 'Aquest quadern tracta els conflictes ètics originats pel mateix concepte de progrés mèdic a la vegada que planteja els diferents interessos de la indústria farmacèutica. Compila la ponència La influencia del progreso médico y la industria farmacéutica sobre nuestra salud presentada pel Director del Fondo de Investigación Sanitaria, Dr. Fernando García Alonso, i la ponència La industria farmacéutica y el progreso médico impartida pel Director General dels Laboratorios S.A.L.V.A.T., Sr. Javier Peris. Aquestes dues visions van obrir el debat entre un grup de farmacòlegs, metges, filòsofs i periodistes, les aportacions dels quals també són recollides a la publicació. (Font: Fundació Víctor Grífols i Lucas)

', 'Este cuaderno trata los conflictos éticos originados por el mismo concepto de progreso médico a la vez que plantea los distintos intereses de la industria farmacéutica. Compila la ponencia La influencia del progreso médico y la industria farmacéutica sobre nuestra salud presentada por el Director del Fondo de Investigación Sanitaria, Dr. Fernando García Alonso y la ponencia La industria farmacéutica y el progreso médico impartida por el Director General de los Laboratorios S.A.L.V.A.T., Sr. Javier Peris. Estas dos visiones abrieron el debate entre un grupo de farmacólogos, médicos, filósofos y periodistas, cuyas aportaciones también quedan recogidas en la publicación. (Fuente: Fundació Víctor Grífols i Lucas)

', '1', 51, 'cas'),
	(269, 'Los fines de la medicina', '', 'http://www.fundaciogrifols.org/docs/pub11%20esp.pdf', '2005-06-02', ' El document que elaborà el grup dinvestigadors del Hastings Center, i que ara traduïm a lespanyol, és un intent de desmitificar la medicina, a fi que lexercici de la mateixa constitueixi efectivament un progrés per a la humanitat. Els fins de la medicina, a finals del segle XX, han de ser alguna cosa més que la curació de la malaltia i lallargament de la vida. (Font: Fundació Víctor Grífols i Lucas)

', ' El documento que elaboró el grupo de investigadores del Hastings Center, y que ahora traducimos al castellano, es un intento de desmitificar la medicina, a fin de que el ejercicio de la misma constituya efectivamente un progreso para la humanidad. Los fines de la medicina, a finales del siglo XX, deben ser algo más que la curación de la enfermedad y el alargamiento de la vida. (Fuente: Fundació Víctor Grífols i Lucas)

', '1', 51, 'cas'),
