	(391, 'Diagnòstic Vascular (SEACV)', 'Sociedad Española de Angiología y Cirugía Vascular (SEACV)', 'http://www.cdvni.org/', '2006-09-14', 'Web creada per la Sociedad Española de Angiología y Cirugía Vascular (SEACV) per a l´estudi, difusió i aplicació de tècniques diagnòstiques aplicades a la fisiopatologia vascular.', 'Web creada por la Sociedad Española de Angiología y Cirugía Vascular (SEACV) para el estudio, difusión y aplicación de técnicas diagnósticas aplicadas a la fisiopatología vascular. ', '9', 0, 'cas'),
	(393, 'Vascular & Endovascular Surgery - Interesting Cases', 'Stanford School of Medicine', 'http://vascular.stanford.edu/techniques/cases.html', '2006-09-14', 'Web de la Stanford School of Medicine amb un ampli contingut en Cirurgia Vascular i Endovascular.  ', 'Web de la Stanford School of Medicine con un amplio contenido en Cirugía Vascular y Endovascular.', '3', 0, 'ang'),
	(271, 'Ética y sedación al final de la vida', '', 'http://www.fundaciogrifols.org/docs/pub9%20esp.pdf', '2005-06-02', ' La pràctica de la sedació involucra duna banda el respecte per lautonomia i la dignitat de la persona i per laltra, la promoció de lexcel·lència en els professionals sanitaris que socupen dels malalts en la proximitat de la mort.

Lobjectiu daquest quadern és publicar el debat que es dugué a terme entre pal·liativistes, oncòlegs, internistes, cirurgians, administradors sanitaris, periodistes, psiquiatres, psicòlegs, infermeres, juristes i bioètics tractant davançar en el coneixement i la bona praxi de la sedació per facilitar la labor dels clínics. (Font: Fundació Víctor Grífols i Lucas)', ' La práctica de la sedación involucra por una parte el respeto por la autonomía y dignidad de la persona y por otra, la promoción de la excelencia en los profesionales sanitarios que se ocupan de los enfermos en la proximidad de la muerte.

El objetivo de ese cuaderno es publicar el debate que se realizó entre paliativistas, oncólogos, internistas, cirujanos, administradores sanitarios, periodistas, psiquiatras, psicólogos, enfermeras, juristas y bioéticos tratando de avanzar en el conocimiento y la buena praxis de la sedación para facilitar la labor de los clínicos. (Fuente: Fundació Víctor Grífols i Lucas)', '1', 51, 'cas'),
